import React from 'react'
import { Input } from 'semantic-ui-react'

const Form = props => (
  <form onSubmit={props.getRecipe}>
    <Input icon={{ name: 'search', circular: true, link: true }} placeholder='Search...' />
  </form>
);

export default Form
